TEMPLATE CDS_CTV_SLOTS;

// DEVISE ET UNITE DE QUANTITE
CURRENCY_UNIT EUR/MWZ;

// DEFINITION PANIER
BASKET {

 // REGLE D'EXPI
 EXPI_RULE = (D-1, {EDE/EEX}),

 // REGLE DE PAIEMENT
 SETTLEMENT_RULE = (20MTH/+, 1, DELIVERY_BASED), //PAR DEFAUT MONTHLY SETTLED
 SUB_BASKET[10,CDS](-1){
  // PARTIE PHYSIQUE
  PHYSICAL{
     {CDS, EUR/MWZ, (1), PRIORITY}
  },     

   }


 SUB_BASKET[20,CTV](1){
  // PARTIE PHYSIQUE
  PHYSICAL{
    {CTV, EUR/MWZ, (1)}
  },

 }

};

